import React from 'react'

const ErrorNotificationBox = ({ response }) => {
    console.log(response)
    if (response.status === 409) {
        return (
            <div>
                <span>{response.data}</span>
            </div>
        )
    }else {
        return null
    }

}

export default ErrorNotificationBox
